import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const Search = () => {
  return (
    <form className="searchForm">
      <TextField
        variant="outlined"
        label="City"
        color="primary"
        className="formItem"
      ></TextField>
      <TextField
        variant="outlined"
        label="Country Code"
        color="primary"
        className="formItem"
      ></TextField>
      <Button type='submit' variant="contained" color="primary" className="formItem">
        Search
      </Button>
    </form>
  );
};

export default Search;
